const rawData=`



`.split("\n");

var gDigicode = [[1, 2, 3],[4,5,6],[7,8,9]];

function conclusion_2_1() {
	var x = 1;
	var y = 1;
	var answer = "";
	rawData.forEach(str => {
		for (var i = 0 ; i < str.length ; i++) {
			switch(str.charAt(i)) {
				case 'L' : if (x > 0) x--; break;
				case 'U' : if (y > 0) y--; break;
				case 'R' : if (x < 2) x++; break;
				case 'D' : if (y < 2) y++; break;
			}
		}
		answer += ""+gDigicode[y][x];
	});
	return answer;
}

